CREATE TABLE `images` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `album_id` int(11) NOT NULL,
  `user_id` int(11) DEFAULT NULL,
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `filename` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `basename` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `uploaded_at` datetime DEFAULT NULL,
  `taken_at` datetime DEFAULT NULL,
  `year` int(11) DEFAULT NULL,
  `month` int(11) DEFAULT NULL,
  `is_private` tinyint(1) NOT NULL,
  `exif_data` longtext COLLATE utf8_unicode_ci NOT NULL COMMENT '(DC2Type:array)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `filename_unique` (`filename`),
  UNIQUE KEY `basename_unique` (`basename`),
  KEY `IDX_E01FBE6A1137ABCF` (`album_id`),
  KEY `IDX_E01FBE6AA76ED395` (`user_id`),
  KEY `year_month_idx` (`year`,`month`),
  CONSTRAINT `FK_E01FBE6A1137ABCF` FOREIGN KEY (`album_id`) REFERENCES `albums` (`id`) ON DELETE CASCADE,
